import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Landing.module.css';

function Navbar({ active }) {
  return (
    <nav className={styles.navbar}>
      {/* Logo no lado esquerdo */}
      <div className={styles.logoWrapper}>
        <h4 className={`${styles.primaryText}`}>TaskTracker</h4>
      </div>
      {/* Links no lado direito */}
      <ul className={styles.navigationMenu}>
        <li><Link to="/" className={active === "home" ? styles.activeNav : ''}>Home</Link></li>
        <li><Link to="/login" className={active === "login" ? styles.activeNav : ''}>Login</Link></li>
        <li><Link to="/register" className={active === "register" ? styles.activeNav : ''}>Register</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
